import React from 'react';
import { Container, Typography, Grid, Card, CardContent, CardActions, Button, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';

const plans = [
  {
    name: 'Starter',
    price: '$99/mo',
    features: [
      'Digital Storefront',
      'Basic AI Agents',
      'Email Support',
      'Up to 100 leads/month',
    ],
  },
  {
    name: 'Pro',
    price: '$249/mo',
    features: [
      'All Starter features',
      'Advanced AI Agents',
      '24/7 Chat Support',
      'Up to 1000 leads/month',
      'JCI Hospital Coordination',
    ],
  },
  {
    name: 'Enterprise',
    price: 'Custom',
    features: [
      'All Pro features',
      'Dedicated Account Manager',
      'Custom Integrations',
      'Unlimited leads',
    ],
  },
];

const Pricing = () => (
  <Container maxWidth="lg" sx={{ mt: 8 }}>
    <Typography variant="h3" fontWeight="bold" align="center" gutterBottom>
      Pricing Plans
    </Typography>
    <Grid container spacing={4} mt={2} justifyContent="center">
      {plans.map((plan, idx) => (
        <Grid item xs={12} sm={6} md={4} key={idx}>
          <Card elevation={3} sx={{ height: '100%' }}>
            <CardContent>
              <Typography variant="h5" fontWeight="bold" gutterBottom align="center">
                {plan.name}
              </Typography>
              <Typography variant="h4" color="primary" align="center" gutterBottom>
                {plan.price}
              </Typography>
              <List>
                {plan.features.map((feature, i) => (
                  <ListItem key={i}>
                    <ListItemIcon>
                      <CheckCircleIcon color="success" />
                    </ListItemIcon>
                    <ListItemText primary={feature} />
                  </ListItem>
                ))}
              </List>
            </CardContent>
            <CardActions sx={{ justifyContent: 'center' }}>
              <Button variant="contained" color="primary" disabled={plan.name === 'Enterprise'}>
                {plan.name === 'Enterprise' ? 'Contact Us' : 'Get Started'}
              </Button>
            </CardActions>
          </Card>
        </Grid>
      ))}
    </Grid>
  </Container>
);

export default Pricing;
